import React from "react";

function CheckoutSteps(props) {
    return<div>
        <div className="progress" style={{ height: "30px" }}>
            <div className="progress-bar bg-primary" role="progressbar" style={{width: "25%", border: "border: 5px solid red;"}} aria-valuenow="15" aria-valuemin="0"
                 aria-valuemax="100">Sign-in</div>
            <div className="progress-bar bg-primary" role="progressbar" style={{width: "25%"}} aria-valuenow="30"
                 aria-valuemin="0" aria-valuemax="100">Shipping</div>
            <div className="progress-bar bg-secondary" role="progressbar" style={{width: "25%"}} aria-valuenow="20"
                 aria-valuemin="0" aria-valuemax="100">Payment</div>
            <div className="progress-bar bg-secondary" role="progressbar" style={{width: "25%"}} aria-valuenow="20"
                 aria-valuemin="0" aria-valuemax="100">Place Order</div>
        </div>
        {/*<span className="ml-3 mr-5">Sign-in</span>*/}
        {/*<span className="ml-3 mr-5">Shipping</span>*/}
        {/*<span className="ml-3 mr-5">Payment</span>*/}
        {/*<span className="ml-3">Place Order</span>*/}
    </div>

}

export default CheckoutSteps
